import React, { Component } from 'react';


class component1 extends Component{

    constructor() {
        super();
        this.state = {
            number:0
        }
    }

    render() {
        return (
            <div className='container'>
                <h1>{this.state.number}</h1>
            <button className='btn btn-primary'>click!</button>
            </div>
        )
    }
}

export default component1;
